foreach my $aref (@{$icon_aref}) {
  my $file_name     = $aref->[0] . q(.svg);
  my $svg_path_str  = $aref->[1];

  my $out_str = $svg_tmplt;
  $out_str =~ s?XX_svg_path_XX?$svg_path_str?g;

  my $HANDLE;
  open $HANDLE, '>>', $file_name
    or croak "cannot open $file_name: $OS_ERROR";
  print { $HANDLE } $out_str
    or croak "Cannot write to $file_name: $OS_ERROR";
  close $HANDLE
    or croak "Cannot close $file_name: $OS_ERROR";
}

exit 0
